import{_ as e,c as t,a8 as a,o as l}from"./chunks/framework.BDnHobkS.js";const u=JSON.parse('{"title":"Набори для збірки (Multicopter)","description":"","frontmatter":{},"headers":[],"relativePath":"uk/frames_multicopter/kits.md","filePath":"uk/frames_multicopter/kits.md"}'),o={name:"uk/frames_multicopter/kits.md"};function i(h,r,s,c,m,p){return l(),t("div",null,r[0]||(r[0]=[a('<h1 id="набори-для-збірки-multicopter" tabindex="-1">Набори для збірки (Multicopter) <a class="header-anchor" href="#набори-для-збірки-multicopter" aria-label="Permalink to &quot;Набори для збірки (Multicopter)&quot;">​</a></h1><p>Набори мультикоптерів містять майже всі частини, необхідні для побудови транспортного засобу, сумісного з PX4.</p><p>Вони надають легке введення у збірку дронів, оскільки всі частини відомі як добре працюючі разом.</p><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>Батарейки не включені! Kits generally do not include:</p><ul><li><strong>Батареї</strong> - Регламенти доставки означають, що вони зазвичай повинні бути окремим джерелом</li><li><strong>Пульт дистанційного керування</strong> - Передавачі / приймачі не включені в комплект для збірки, щоб зекономити кошти. Багато користувачів вже мають портативний земний блок, і для цього знадобиться сумісний модуль на транспортному засобі.</li></ul></div><h2 id="набори" tabindex="-1">Набори <a class="header-anchor" href="#набори" aria-label="Permalink to &quot;Набори&quot;">​</a></h2><p>Наступні комплекти в даний час доступні:</p><ul><li><a href="https://holybro.com/collections/x500-kits" target="_blank" rel="noreferrer">Holybro X500 v2 PX4 Development Kit</a> (Pixhawk 6c) (<a href="./../frames_multicopter/holybro_x500v2_pixhawk6c.html">Build instructions</a>)</li><li><a href="https://holybro.com/collections/s500/products/s500-v2-development-kit" target="_blank" rel="noreferrer">Holybro S500 Kit v2</a> (Pixhawk 6c)</li><li><a href="https://holybro.com/products/qav250-kit" target="_blank" rel="noreferrer">Holybro QAV250 Kit</a> (Pixhawk 6c)</li><li><a href="https://www.nxp.com/KIT-HGDRONEK66" target="_blank" rel="noreferrer">NXP HoverGames KIT-HGDRONEK66</a> (<a href="https://www.hovergames.com/" target="_blank" rel="noreferrer">hovergames.com</a>)</li><li><a href="https://store.3dr.com/3dr-quad-zero-kit/" target="_blank" rel="noreferrer">3DR Quad Zero</a></li></ul><h2 id="посібники-зі-збірки" tabindex="-1">Посібники зі збірки <a class="header-anchor" href="#посібники-зі-збірки" aria-label="Permalink to &quot;Посібники зі збірки&quot;">​</a></h2><p>Нижче наведені інструкції зі складання для декількох комплектів. Багато наборів відрізняються лише трохи між ревізіями (наприклад, новий набір може просто оновити використаний контролер польоту, інакше він ідентичний), тому їх ймовірно буде корисно використовувати для збирання наборів у розділі вище.</p><ul><li><a href="./../frames_multicopter/holybro_x500v2_pixhawk6c.html">Holybro X500 v2 (Pixhawk 6C)</a></li><li><a href="./../frames_multicopter/holybro_x500V2_pixhawk5x.html">Holybro X500 v2 (Pixhawk 5X)</a> — Знятий з виробництва (комплект v2 використовує Pixhawk 6c)</li><li><a href="./../frames_multicopter/holybro_x500_pixhawk4.html">Holybro X500 v1 (Pixhawk 4)</a> — Знятий з виробництва (комплект v2 використовує Pixhawk 6c)</li><li><a href="./../frames_multicopter/holybro_s500_v2_pixhawk4.html">Holybro S500 v2 (Pixhawk 4)</a> — Знятий з виробництва (комплект v2 використовує Pixhawk 6c)</li><li><a href="./../frames_multicopter/holybro_qav250_pixhawk4_mini.html">Holybro QAV250 Kit (Pixhawk 4 mini)</a> — Знятий з виробництва (поточний комплект використовує Pixhawk 6c)</li><li><a href="./../frames_multicopter/qav_r_5_kiss_esc_racer.html">Lumenier QAV-R 5&quot; Racer (Pixracer)</a> — Припинено</li></ul>',10)]))}const _=e(o,[["render",i]]);export{u as __pageData,_ as default};
